extern uint64_t _spring_matrix[256][256];



#define PI 3.14159265358979323846264338327950288419716


typedef struct spring_bits
{
  shnum_t lat;
  shnum_t lon;
  unsigned int x, y;
  unsigned int lat1, lat2;
  unsigned int lon1, lon2;
} spring_bits;


extern uint8_t* shsha1_result(shsha1_t *s);

unsigned int spring_matrix_bit(uint64_t seed)
{
  shsha1_t s;
  uint8_t *result;
  uint32_t val;
  unsigned int *i_ptr;
  int i;

  seed = htonll(seed);

  memset(&s, 0, sizeof(s));
  shsha1_init(&s);
  shsha1_write(&s, (const char *)&seed, sizeof(seed));
  result = shsha1_result(&s);

  val = 0;
  i_ptr = (uint32_t *)result;
  for (i = 0; i < 5; i++) {
    val += i_ptr[i];
  }

  return (val % 32);
}


static void spring_loc_bits(spring_bits *bits)
{
  uint32_t abs_lat, abs_lon;
  uint64_t b_lat, b_lon;
  shnum_t lat;
  shnum_t lon;

  lat = bits->lat;
  lon = bits->lon;

  /* collapse hemisphere into 'uni-sphere' */
  if (lat < 0) lat = lat * -1;
  if (lon < 0) lon = lon * -1;

  abs_lat = (uint32_t)lat;
  abs_lon = (uint32_t)lon;

  /* transition offset and ratio used to match matrix size */
  bits->y = (int)((lat - SPRING_OFFSET_LATITUDE) * SPRING_Y_FACTOR) % 256;
  bits->x = (int)((lon - SPRING_OFFSET_LONGITUDE) * SPRING_X_FACTOR) % 256;

  b_lat = (uint64_t)((lat - (shnum_t)abs_lat) * 1000.0);
  bits->lat1 = spring_matrix_bit(b_lat) % 32;
  bits->lat2 = spring_matrix_bit(b_lat/8) % 32;

  b_lon = (uint64_t)((lon - (shnum_t)abs_lon) * 1000.0);
  bits->lon1 = spring_matrix_bit(b_lon) % 32;
  bits->lon2 = spring_matrix_bit(b_lon/8) % 32;
}



void spring_loc_set(double lat, double lon)
{
  spring_bits bits;
  uint32_t *i_ar;

  memset(&bits, 0, sizeof(bits));
  bits.lat = lat;
  bits.lon = lon;
  spring_loc_bits(&bits);

  i_ar = (uint32_t *)&_spring_matrix[bits.y][bits.x];
  i_ar[0] |= (1 << bits.lat1);
  i_ar[0] |= (1 << bits.lat2);
  i_ar[1] |= (1 << bits.lon1);
  i_ar[1] |= (1 << bits.lon2);
}


int is_spring_loc(double lat, double lon)
{
  spring_bits bits;
  uint32_t *i_ar;

  memset(&bits, 0, sizeof(bits));
  bits.lat = lat;
  bits.lon = lon;
  spring_loc_bits(&bits);

  if (bits.lat1 == bits.lat2 || bits.lon1 == bits.lon2)
    return (FALSE);

  i_ar = (uint32_t *)&_spring_matrix[bits.y][bits.x];
  if (
      (i_ar[0] & (1 << bits.lat1)) &&
      (i_ar[0] & (1 << bits.lat2)) &&
      (i_ar[1] & (1 << bits.lon1)) &&
      (i_ar[1] & (1 << bits.lon2))
     ) {
    return (TRUE);
  }

  return (FALSE);
}

void spring_loc_claim(double lat, double lon)
{
  spring_bits bits;
  uint32_t *i_ar;

  memset(&bits, 0, sizeof(bits));
  bits.lat = lat;
  bits.lon = lon;
  spring_loc_bits(&bits);

  if (bits.lat1 == bits.lat2 || bits.lon1 == bits.lon2)
    return;

  /* remove first bits */
  i_ar = (uint32_t *)&_spring_matrix[bits.y][bits.x];
  if (
      (i_ar[0] & (1 << bits.lat1)) &&
      (i_ar[0] & (1 << bits.lat2)) &&
      (i_ar[1] & (1 << bits.lon1)) &&
      (i_ar[1] & (1 << bits.lon2))
     ) {
    i_ar[0] &= ~(1 << bits.lat1);
    i_ar[1] &= ~(1 << bits.lon1);
  }

fprintf(stderr, "DEBUG: SPRING CLAIM: lat(%f) lon(%f) [y(%d) x(%d)]\n", lat, lon, bits.y, bits.x);
}

int spring_loc_search(shnum_t cur_lat, shnum_t cur_lon, shnum_t *lat_p, shnum_t *lon_p)
{
  shnum_t s_lat, e_lat;
  shnum_t s_lon, e_lon;
  shnum_t lat, lon;
  int total;
  int found;

  s_lat = cur_lat - 0.25;
  s_lon = cur_lon - 0.25;
  e_lat = cur_lat + 0.25;
  e_lon = cur_lon + 0.25;

  for (lat = s_lat; lat <= e_lat; lat += 0.001) {
    for (lon = s_lon; lon <= e_lon; lon += 0.001) {
      if (is_spring_loc(lat, lon)) {
        *lat_p = lat;
        *lon_p = lon;
        return (0);
      }
    }
  }

  return (SHERR_NOENT);
}

void spring_matrix_compress(uint32_t matrix[3][3])
{
  int row, col;
  int y, x;

  for (row = 0; row < 3; row++) {
    for (col = 0; col < 3; col++) {
      matrix[row][col] = 0;
    }
  }

  for (y = 0; y < 256; y++) {
    for (x = 0; x < 256; x++) {
      row = (int)(y / 85) % 3;
      col = (int)(x / 85) % 3;
      matrix[row][col] += (uint32_t)_spring_matrix[y][x];
    }
  }

}

int spring_render_fractal(char *img_path, double zoom)
{
  static const unsigned int width = 256, height = 256;
  BMP *bmp;
  uint32_t m_seed;
  uint32_t val;
  shnum_t seed;
  shnum_t rate;
  shnum_t K;
  shnum_t Z;
  shnum_t C;
  shnum_t min_cord;
  shnum_t max_cord;
  shnum_t dx, dy;
  unsigned int x, y;
  int cval;
  int idx;
  unsigned char r, g, b;

  bmp = BMP_Create(width*10, height*10, 32);

  m_seed = 0;
  for (y = 0; y < height; y++) {
    for (x = 0; x < width; x++) {
      m_seed += _spring_matrix[y][x];
    }
  }
  //seed = (shnum_t)m_seed / 16;
  seed = (shnum_t)(m_seed / 256);
  seed = seed / 65536;

  zoom = MAX(0.001, MIN(100.0, zoom));
  rate = 0.1 * zoom;
  min_cord = (-128 * zoom);
  max_cord = (128 * zoom);
  for (dy = min_cord; dy <= max_cord; dy += rate) {
    for (dx = min_cord; dx <= max_cord; dx += rate) {
      C = (dx * dy) + seed;

      Z = 0;
      for (idx = 0; idx < 8; idx++) {
        Z = Z * Z + C;
        if (fabs(Z) >= 2)
          break;
      }
      if (idx == 8) {
        r = g = b = 0;
      } else {
        K = fabs(Z*C);
        val = 4294967296 % (uint32_t)(K+1);
        r = (val >> 16) & 0xff;
        g = (val >> 8) & 0xff;
        b = val & 0xff;

        r = MIN(255, r + idx);
        g = MIN(255, g + idx);
        b = MIN(255, b + idx);
      }
      x = (int)((dx + max_cord) / rate) % width;
      y = (int)((dy + max_cord) / rate) % height;
      BMP_SetPixelRGB( bmp, x, y, r, g, b);
    }
  }
  BMP_WriteFile(bmp, img_path);
  BMP_CHECK_ERROR( stdout, -2 );
  BMP_Free( bmp );
  return 0;
}




